ignore_errors = yes
tune          = base
ext           = Xeon-gcc4.3
output_format = asc, pdf, Screen
max_active_compares=2
iterations	  = 1
#reportable    = 1
teeout        = yes
teerunout     = yes
hw_avail = none
license_num = calab
test_sponsor = 
prepared_by = 
tester      =
test_date = now
dir_result = /tmp/spec

